<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <title>Datasheet</title>
  <link type="image/x-icon" rel="shortcut icon" href="/static/img/favicon.png" />
  <meta http-equiv="X-UA-Compatible" content="IE=edge, chrome=1" />
  <meta name="renderer" content="webkit" />
  <meta name="viewport" content="width=1200">
  <link rel="stylesheet" type="text/css" href="/static/css/common.css">
  <link rel="stylesheet" type="text/css" href="/static/css/datasheet.css">
</head>

<body>
  <div id="site-nav">
  </div>
  <div id="wrapper" class="Container">
    <header id="header"></header>
    <div class="navigation-nav">
      <div class="categoryContainer" style="display: none;">
        <ul class="categoryList"></ul>
      </div>
    </div>
    <div id="main">
      <div class="SiteMap"></div>
      <div class="searchResultContainer">
        <div class="headline">
          <i></i>Results:<strong>0</strong>
        </div>
        <div class="itemhead">
          <span class="type">Part No.</span>
          <span class="down">Preview</span>
        </div>
        <ul class="dataItem"></ul>
        <div class="pageContainer pagelist"></div>
        <div class="Clear"></div>
      </div>
      <div class="noDataContainer">
        <h2>Sorry,we find nothing about "<span class="key"></span>"</h2>
        <p>Try another characters or <a href="javascript:;" class="redirectInquiryPage">Post Quick inquiry</a> to tell us what<br/>you want to buy</p>
          <a href="javascript:;" class="redirectInquiryPage btnPrimary postQuickInquiry">Post Quick inquiry</a>
      </div>
    </div>
    <footer id="footer"></footer>
  </div>
  <script src="/static/js/vendor/require/require.js"></script>
  <script src="/static/js/config.js"></script>
  <script>
    require(['main/datasheet_index'], function(page) {
      page.init();
    });
  </script>
</body>
